def parse(data, port, origin):
    if port==3333:
        return
    if origin == '':
        return
    if len( data ) >= 2:
        packet_id = struct.unpack( ">H", data[0:2] )[0]
        if packet_id not in handlers:
            # print "[{}({})] \n{}".format(origin, port, data.encode('hex'))
            return
        else:
            handlers.get( packet_id, h_noop )( data[2:] )


